import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import { DndProvider } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';
import WelcomeScreen from './components/WelcomeScreen';
import TemplatesTab from './components/TemplatesTab';
import CreateTab from './components/CreateTab';
import DiscoverTab from './components/DiscoverTab';
import DashboardTab from './components/DashboardTab';
import BuilderTab from './components/BuilderTab';
import FeedPage from './pages/FeedPage';
import TradeTerminal from './components/TradeTerminal';
import StrategyWorkspace from './components/StrategyWorkspace';

const NAV = [
  { name: 'Feed', path: '/feed' },
  { name: 'FAQ', path: '/faq' },
  { name: 'Import', path: '/import' },
];

function AppContent() {
  const navigate = useNavigate();
  const [showBuilder, setShowBuilder] = useState(false);
  const [selectedTemplate, setSelectedTemplate] = useState(null);

  const handleCardClick = (tabName) => {
    switch (tabName) {
      case 'Templates':
        navigate('/templates');
        break;
      case 'Create':
        navigate('/create');
        break;
      case 'Discover':
        navigate('/discover');
        break;
      case 'Dashboard':
        navigate('/dashboard');
        break;
      case 'Feed':
        navigate('/feed');
        break;
      default:
        navigate('/');
    }
  };

  const goBack = () => {
    setShowBuilder(false);
    navigate('/');
  };

  const handleTryFlow = (template) => {
    setSelectedTemplate(template);
    setShowBuilder(true);
  };

  return (
    <div className="min-h-screen bg-transparent">
      {/* Top Navigation Bar */}
      <div className="flex justify-between items-center px-6 py-4 bg-black/80 backdrop-blur-md shadow-sm border-b border-neutral-800 sticky top-0 z-10">
        <div className="flex items-center space-x-4">
          <h1 className="text-xl font-bold text-white cursor-pointer" onClick={() => navigate('/')}>
            SCOPE<span className="text-purple-500">²</span>
          </h1>
          <div className="flex space-x-4 text-sm text-white/80">
            {NAV.map((item) => (
              <button
                key={item.name}
                className="font-semibold px-4 py-2 rounded-full transition-all duration-200 shadow-inner hover:text-white/90"
                onClick={() => navigate(item.path)}
              >
                {item.name}
              </button>
            ))}
          </div>
        </div>
        <div className="text-sm text-right text-purple-400 italic drop-shadow-[0_0_6px_rgba(168,85,247,0.7)]">
          <span className="font-semibold text-purple-500">news2pump</span> powered
        </div>
      </div>

      <main className="flex flex-col items-center justify-center flex-1 w-full">
        <Routes>
          <Route path="/" element={<WelcomeScreen onCardClick={handleCardClick} />} />
          <Route path="/templates" element={<TemplatesTab goBack={goBack} onTryFlow={handleTryFlow} />} />
          <Route path="/create" element={<CreateTab goBack={goBack} />} />
          <Route path="/discover" element={<DiscoverTab goBack={goBack} />} />
          <Route path="/dashboard" element={<DashboardTab goBack={goBack} />} />
          <Route path="/feed" element={<FeedPage />} />
          <Route path="/trade" element={<TradeTerminal />} />
          <Route path="/workspace" element={<StrategyWorkspace />} />
          {showBuilder && <Route path="/builder" element={<BuilderTab goBack={goBack} template={selectedTemplate} />} />}
        </Routes>
      </main>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <DndProvider backend={HTML5Backend}>
        <AppContent />
      </DndProvider>
    </Router>
  );
}
